10.times do |blog|
	Blog.create!(
		title: "My blog Post #{blog}",
		body: "hello hi nice to meet you"
		)
end

puts "10 blog posts created"

5.times do |skill|
	Skill.create!(
		title: "Rails #{skill}",
		percent_utilized: 15
		)
end

puts "5 skill posts created"

9.times do |portfolio|
	Portfolio.create!(
	title: "portfolio #{portfolio}",
	subtitle: "hi",
	body: "adasdasdsadsadasdsa",
	main_image: "data:image/jpeg;base64," ,
	thumb_image:"data:image/jpeg;base64,"
		)
end

puts "9 portfolio posts created"
